import React from 'react';
        import { Routes, Route } from 'react-router-dom';

        import Project from './project';
        import Projects from './projects';

        const Main = () => {
        return (
<Routes>
    <Route path='/' element={<Projects/>}></Route>
<Route path='/project' element={<Project/>}></Route>
        </Routes>
        );
        }

        export default Main;
